import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
//import logo from './logo.svg';
import './App.css';
import Row from './Components/Row.js';
import Col from './Components/Col.js';
import Button from './Components/Button.js';
import Table from './Components/Table.js';
import Map from './Components/Map.js';
import Icon from './Components/Icon.js';
import SearchForm from './Components/SearchForm.js';
import HostForm1 from './Components/HostForm1.js';
import HostForm2 from './Components/HostForm2.js';
import HostForm3 from './Components/HostForm3.js';
import HostForm4 from './Components/HostForm4.js';
import { BrowserRouter, Route, NavLink } from 'react-router-dom'

// import Main from './Main.js';
// import PracticeNewPage from './Components/PracticeNewPage.js';
// import {
//   Route,
//   NavLink,
//   HashRouter
// } from "react-router-dom";
class App extends Component{

    render() {

      const hosts = [
  			{
  				firstName: 'Scott',
  				lastName: 'McConnell',
  				street: '1262 Farm Rd',
  				city: 'Berwyn',
  				state: 'Pennsylvania',
  				zip: '19312',
  				email: 'skm44@duke.edu',
  				phone: '6103124662',
  				spaceType: 'Garage',
  				spaceAvailable: '160',
  				createdAt: new Date()
  			},
  			{
  				firstName: 'Josh',
  				lastName: 'France',
  				street: '220 Alexander Ave',
  				city: 'Durham',
  				state: 'North Carolina',
  				zip: '27705',
  				email: 'jrf36@duke.edu',
  				phone: '9802146075',
  				spaceType: 'Shed',
  				spaceAvailable: '100',
  				createdAt: new Date(),
  			},
  			{
  				firstName: 'Samir',
  				lastName: 'Agadi',
  				street: '207 Erwin Rd',
  				city: 'Durham',
  				state: 'North Carolina',
  				zip: '27705',
  				email: 'sa280@duke.edu',
  				phone: '2486335250',
  				spaceType: 'Closet',
  				spaceAvailable: '50',
  				createdAt: new Date(),
  			},
  		];


//*ATTRIBUTE PROPS**//
  const navButtonAttr = {
    'className': "navbar-toggler",
    'type': 'button',
    'aria-label':"Toggle navigation",
    'data-toggle':"collapse",
    'data-target':"#navbarSupportedContent",
     'aria-controls':"navbarSupportedContent",
     'aria-expanded':"false"
  };

  const searchInputAttr ={
    'className':"form-control mr-sm-2",
    'type':"search",
    'placeholder':"Find space near you",
    'aria-label':"Find space near you"
  }
  const searchButtonAttr = {
    'className':"btn btn-outline-success my-2 my-sm-0",
    'type':"submit",
    'id':"searchBarButton"
  }
  const searchFormAttr= {
    'className':"form-inline my-2 my-lg-0"
  }
  const navButtonLabel=(<span><Icon iconType="navbar-toggler-icon"/></span>);

  //to add to json string file:
  const searchButtonLabel = "Search";
  const hostLabel = "Become a Host";

    return (
      <BrowserRouter>
      <div className="App">
        <header className="App-header">

        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <img className="navbar-brand" src="/OpenSpaceRevised.png" alt="OpenSpaceRevised"></img>
          <Button attr={navButtonAttr} label={navButtonLabel}/>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto">
              <SearchForm formAttr = {searchFormAttr} inputAttr={searchInputAttr} buttAttr={searchButtonAttr} searchButtonLabel={searchButtonLabel}/>
            </ul>
            <a className="nav-link disabled" href="/BecomeAHost">{hostLabel}</a>
          </div>
        </nav>

        <Table dataPoints={hosts} colSpacing="col-md-6"/>

        <Map colSpacing = "col-md-6"/>
      </header>
      </div>

      </BrowserRouter>
    );
  }

}
export default App;
